AA67-CCEあなたもこれで憧れのビックキャリパーに！ウェーバースポーツのキャリパーカバーは車種別に設計されているので、フィッティング抜群。しっかり固定が出来、奥行きまで作り込みをしているので、ホイールを取り付けした後、純正キャリパーが見えずボリューム感があります。<br><br>●材質 ： FRP製・厚さ約3mm 本物銅パイプ、ブリーダプラグ、キャップを使用。●取り付けは金属のステイやホースバンドにスプリングを引っ掛けるだけでOKです。タイヤさえ外せればカンタンにD.I.Yが可能です！※取り付けにはホイールの裏側とキャリパーの間に、約2cm～3cmの隙間が最低限必要になります。干渉する際には別途3mm～5mm以上のホイールスペーサーが必要となります。<br><br>●写真はイメージです。形状は車種ごとに変わります。 ●本体カラー、ロゴマーク、ロゴカラーは商品タイトルの物になります。※オプションでロゴマーク、ロゴカラーが変更可能です（別途費用が発生する場合があります）。ロゴを転写してから、耐熱クリアコーティングで仕上げておりますので、変更希望の場合には必ずご注文時にお知らせください。 ※適合確認必須の為、ご注文時に必ず詳細な車種情報をご連絡ください。 ※受注生産品となります為、納期は約３週間前後になります。※受注生産品につき代引・返品交換対応不可となります。お間違いのないようにご注文ください。<br><br><br>対応車種：スバル レガシィ ツーリングワゴン 12.5～ BRG (2.0GT DIT) ※純正キャリパーを４ポットに流用している車種が多い為、現車確認をしていただくことをおすすめします。<br><br>ブレーキ | ブレーキその他<br>スバル | レガシィ | BM/BR系<tr><td colspan="2">
